import React from 'react';
import Footer from '../components/Footer';
import Navigation from '../components/Navigation';

const Blog = () => {
    return (
        <div className="blog">
            <Navigation />
            <h2>Nos animaux</h2>
            <p></p>
            <Footer />
        </div>
    );
};

export default Blog;
